By whiskering, we define the natural transformations
  \theta  = F\xrightarrow {F\eta '}FGF'\xrightarrow {\epsilon  F'} F'\quad \text {and}\quad  \theta '   = F'\xrightarrow {F'\eta }F'GF\xrightarrow {\epsilon  F} F. Now the following diagram commutes:





    \usepackage{tikz, tikz-cd, mathtools, amssymb}
  \usetikzlibrary{shapes.geometric}
  \usetikzlibrary{calc}
  \usetikzlibrary{matrix}
  \usetikzlibrary{decorations.markings}

  \tikzset{
    % basics
    square/.style={draw, regular polygon, regular polygon sides=4},
    triangle/.style={draw, regular polygon, regular polygon sides=3},
  }

  \tikzset{
    % string diagrams
    state/.style={triangle, shape border rotate=180, anchor=north},
    costate/.style={triangle, anchor=south},
    morphism/.style={draw, rectangle},
    over/.style={
      draw=white,
      double=black,
      % default is .4pt
      line width=1.2pt,
      double distance=.4pt,
      text=black
    },
  }

  \tikzset{ 
    % tables
    % https://tikz.net/tikz-table/
    table/.style={
        matrix of nodes,
        row sep=-\pgflinewidth,
        column sep=-\pgflinewidth,
        nodes={
            rectangle,
            draw=black,
            align=center
        },
        minimum height=1.5em,
        text depth=0.5ex,
        text height=2ex,
        nodes in empty cells,
%%
        every even row/.style={
            nodes={fill=gray!20}
        },
        column 1/.style={
            nodes={font=\bfseries}
        },
        row 1/.style={
            nodes={
                fill=black,
                text=white,
                font=\bfseries
            }
        }
    }
  }


    \begin {tikzcd}
      & & F'\ar [dr, "F'\eta "']\ar [drdr, "\theta '", bend left] \\
      & FGF'\ar [ur, "\epsilon  F'"']\ar [dr, "FGF'\eta "] & & F'GF\ar [dr, "\epsilon  F"'] \\
      F\ar [ruru, "\theta ", bend left]\ar [rrrr, "1_F"', bend right=100]\ar [ur,
      "F\eta '"']\ar [dr, "F\eta "'] & & FGF'GF\ar [ur, "\epsilon 
      F'GF"]\ar [dr, "FG\epsilon ' F"] & & F\makebox [0pt][l]{.} \\
      & FGF\ar [rr, "F1_GF"']\ar [ur, "F\eta ' GF"] & & FGF\ar [ur, "\epsilon  F"']
    \end {tikzcd}


 Indeed, the top two triangles are definitions of \theta  and \theta ',
  the squares are each instances of the interchange law, while the
  triangle and the bottom shape are both instances of the left triangle
  identity. The other direction of invertibility follows by symmetry.

To show that \theta  commutes with the units and counits, we observe
  that the following diagram commutes: 




    \usepackage{tikz, tikz-cd, mathtools, amssymb}
  \usetikzlibrary{shapes.geometric}
  \usetikzlibrary{calc}
  \usetikzlibrary{matrix}
  \usetikzlibrary{decorations.markings}

  \tikzset{
